import React, { Fragment } from 'react';

const HourlyForecast = ({hourlyForecast}) => {
  return(
    <Fragment>
      {Object.keys(hourlyForecast).map((key) => {
        return (
          <p>{key}</p>
        );
      })}
    </Fragment>
  );
};

export default HourlyForecast;
